import React from 'react';
import Layout from "../components/layout";

const Dashboard = () => (
    <div>
        <Layout/>
        <h1>Once again... WELCOME!</h1>
        <p>Let's start by designing our layout :P</p>
        <ol>
            <li>Login</li>
            <li>Metadata</li>
            <li>Dashboard</li>

        </ol>
    </div>
);

export default Dashboard;
